import React from 'react'



export default function PrintCards(props) {
    return (
        props.cards.map((card) => 
                <div className="card">
                    <div className="photo">
                        <img src={"img/" + card.img} alt="" width="100px" height="100px"></img>
                    </div>
                    <div className="card-text">
                        {card.text}
                    </div>
                </div>
        )
    )
}
